<div class="entities" style="line-height: 2.5; direction: ltr">Cytoplasmic and nuclear estrogen binding capacity in the rat uterus during treatment with danazol and testosterone . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01406
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 , testosterone and dihydrotestosterone ( DB02901 ) were tested as competitors for estrogen receptors on immature rat uterus cytosol . No competitive binding could be demonstrated for any of these steroids . After that , prepubertal Wistar rats were exposed to danazol , testosterone or propylene glycol ( control ) for 3 days or 17 days . After the appropriate exposure to medication , the animals were killed . Both danazol and testosterone appeared to be uterotropic after 3 days of treatment , although the increase in the uterine weight was significant only in the danazol-treated group ( p less than 0.05 ) . This effect was lost after 17 days of treatment . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P03372
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 binding assays were done on the cytosolic and nuclear fractions of the homogenized uterine tissue of each group . The estrogen binding capacity of cytosols was increased in both the danazol ( p less than 0.05 ) and the testosterone ( p less than 0.01 ) groups after 3 days of treatment . A parallel increase was found in the nuclear fraction of both groups . After 17 days of treatment , the comparison between the 3 groups showed no differences in the cytosolic or nuclear estrogen binding capacity . The information provided by this study suggests that some effects of danazol may be due to an androgenic action and that may be associated to increases in the free fraction of testosterone .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">F-actin involvement in guinea pig sperm motility . Sperm motility is a must for natural fertilization to occur . During their travel through the epididymis , mammalian spermatozoa gradually acquire the ability to move . This is accomplished through a sliding movement of the outer doublet microtubules of the axoneme which is energized by the dynein ATPase . Within its complex structure , the mammalian sperm flagellum contains F-actin and thus , we decided to test in the guinea pig sperm flagellum the role of F-actin in motility . During maturation , capacitation , and the acrosome reaction , a gradual decrease of the relative concentration of F-actin was observed . Motility increased as spermatozoa became able to fertilize . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P06396
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , phalloidin , and KI inhibited sperm motility . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P06396
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 canceled sperm motility within 20 min of treatment while 0.6 M KI had immediate effects . Phalloidin diminished hyperactive sperm motility slightly . All three compounds significantly increased the relative concentration of F-actin . Latrunculins are conventional drugs that destabilize the F-actin cytoskeleton .

 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">Inhibition of brain prostaglandin endoperoxide synthase - 2 prevents the preparturient increase in fetal adrenocorticotropin secretion in the sheep fetus . Maturation of the fetal hypothalamus-pituitary-adrenal axis is critical for the timely somatic development of the fetus and readiness for birth . Recently , we proposed that prostaglandin generation within the fetal central nervous system is critical for the modulation of hypotension-induced fetal DB01285 secretion . The present study was designed to test the hypothesis that the preparturient increase in fetal DB01285 secretion is dependent upon fetal central nervous system prostaglandin synthesis mediated by the activity of prostaglandin endoperoxide synthase ( PGHS ) - 2 ( cyclooxygenase - 2 ) in the fetal brain . We performed two studies in chronically catheterized fetal sheep . In the first study , we infused nimesulide or vehicle intracerebroventricularly ( i . c . v ) into singleton fetal sheep and collected blood samples until spontaneous parturition .

 was selectively blocked by using pralnacasan or

 . IL - 1beta release was induced in mouse organotypic hippocampal slice cultures by proinflammatory stimuli [ lipopolysaccharide ( LPS ) + adenosine triphosphate ( DB00171 ) ] and measured with enzyme-linked immunosorbent assay ( ELISA ) . IL - 1beta production during seizures was measured in the rat hippocampus by Western blot . Seizures were induced in freely moving mice and rats by intrahippocampal injection of kainic acid and recorded by EEG analysis . RESULTS :

 inhibition reduced the release of IL - 1beta in organotypic slices exposed to LPS + DB00171 . Administration of pralnacasan ( intracerebroventricular , 50 microg ) or

<div class="entities" style="line-height: 2.5; direction: ltr">Human decorin regulates proliferation and migration of human lung cancer A549 cells . BACKGROUND : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P07585

</mark>
 is a small leucine-rich proteoglycan and it plays an important role in regulation of cell growth and migration in various tumor cell lines . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P07585

</mark>
 was found down-regulated in non-small cell lung cancer tissue and may be involved in regulation of lung cancer development . METHODS : In this study , lentivirus-mediated RNA interference and over expression were employed to change the expression levels of decorin in lung cancer A549 cells . We tested the cell cycle of A549 cells and the expression of transforming growth factor ( TGF ) -  , cyclin D1 , epidermal growth factor receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00533

</mark>
 ) , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04637
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , and P21 . RESULTS : We found that up-regulation of decorin could inhibit proliferation , block cell cycle at P55008 and decrease invasive activity of A549 cells . Moreover , we also show that up-regulation of decorin induced significant decreases of TGF- 1 , cyclin D1 expression , phosphorylation of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00533
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , and increases of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04637
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and P21 expression . Opposite results were observed in A549 cells with down-regulation of decorin . CONCLUSION : Our results suggest that decorin is a key regulator involved in proliferation and migration of A549 cells .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Analysis of breast cancer related gene expression using natural splines and the Cox proportional hazard model to identify prognostic associations . Many studies correlating gene expression data to clinical parameters assume a linear increase or decrease of the clinical parameter under investigation with the expression of a gene . We have studied genes encoding important breast cancer-related proteins using a model for survival-type data that is based on natural splines and the Cox proportional hazard model , thereby removing the linearity assumption . Expression data of 16 genes were studied in relation to metastasis-free probability in a cohort of 295 consecutive breast cancer patients treated at The Netherlands Cancer Institute . The independent predictive power for disease outcome of the 16 individual genes was tested in a multivariable model with known clinical and pathological risk factors . There is a linear relationship between increasing expression and a higher or lower hazard for distant metastasis for
